  protected function buildCompiled($address1, $suburb, $city, $postcode, $state, $countryCodeISO2)
  {
      $info = array();
      $info[] = $address1;
      $info[] = $suburb;
      $info[] = $city . ' ' . $postcode;
      $info[] = $state . ' ' . $countryCodeISO2;
      
      return implode("\n", $info);
  }

  public function buildInsertSql($options = array())
  {
    $count =  $options['count'];
    $start = isset($options['first']) ? $options['first'] : $options['start'];
    $fields = array();
    $sqlBody = array();
    for ($i = $start; $i < $start + $count; $i++) {
      $fields = array();
      $options['index'] = $i;
      $columns = $this->buildData($options);
      if (count($columns) == 0) {
        continue;
      }
      $values = array();
      foreach ($columns as $key => $value) {
        $fields[] = "`$key`";
        if ($value !== null) {
          $value = str_replace('\'', '\\\'', $value);
          $values[] = "'$value'";
        } else {
          $values[] = 'NULL';
        }
      }
      $sqlBody[] = strtr('(@values)', array(
        '@values' => implode(',', $values)
      ));
    }
    if (count($fields) == 0) {
      return '';
    }
    $sqlBody = array_unique($sqlBody);
    $sqlHeader = strtr('INSERT INTO @table(@columns) VALUES', array(
      '@table' => $this->table,
      '@columns' => implode(',', $fields)
    ));

    return $sqlHeader . "\n\t" . implode(",\n\t", $sqlBody) . ';';
  }

  public function buildDeleteSql()
  {
    return strtr('DELETE * FROM @table;', array(
      '@table' => $this->table
    ));
  }

  abstract function getTable();
  abstract function buildData($options = array());
